const importAll = (r) => {
    let images = {};
    r.keys().forEach((item) => {
      images[item.replace('./', '')] = r(item); // Ensure the correct path adjustment
    });
    return images;
  };

  // Import images from the specified folder (relative to this file)
  const images = importAll(require.context('../images', false, /\.(png|jpe?g|svg)$/));

export const pumps = [
